import React from 'react';

const List = (props) => (
        <div>
            <ul style={{'list-style-type':'disc'}}>
                {props.data.filter(listData => (listData.position_id==props.current_id)).map(listData => (
                    <li style={{'list-style-type':'disc'}} className='fh_rec_det_resp_req' key={listData.id}>{listData.brief}</li>
                    ))
                }
            </ul>
        </ div>
    )
     
export default List;
